  false,\n\t\"url\": null,\n\t\"notes\": \"The illustrated field guide to wetland
  and adjacent upland (transitional) plants has been designed to aid the layperson
  in identification of the more common species found in the Lahontan Valley wetlands.
  The guide includes descriptions and illustrations of 176 plants. A glossary of botanical
  terms and some basic illustrations are provided to assist in understanding the botanical
  terminology used in the descriptions. The guide is initially divided into five plant
  groups based on the overall habit of the plant. After careful observation of the
  unknown plant of interest and the habitat in which it occurs, use the following
  dichotomous key to select the group of plants in which it is placed in this guide.
  To use the key, read each couplet (1 and 1', and 2', etc.) and select the couplet
  that best applies.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
